import React from "react";
import CartItem from "./cartItem";

class Cart extends React.Component{
    constructor(){
        super()
        this.state={
            product:[
                {
                    title:'Mobile phone',
                    price:999,
                    qty:1,
                    img:''
                },
                {
                    title:'Watch',
                    price:99,
                    qty:10,
                    img:''
                },
                {
                    title:'chocolate',
                    price:9,
                    qty:4,
                    img:''
                }
            ]
        }
    }
    render(){
        return (
            <div className="cart">
                {product}
                <CartItem />
               
            </div>
        )
    }
}

export default Cart;
